import './App.css';
import { useState, useEffect } from 'react';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetch('/api/greeting')
      .then((res) => res.json())
      .then((data) => setMessage(data.message));

  }, []);

  return (<h1>{message}</h1>);
}

export default App;
